import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import { Home } from './containers/Home.jsx';
function App() {
  return (
    <Router>
      <Switch>
        // ホーム（トップ）ページ
        <Route
          exact
          path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
